import React from "react";
import { useDrag } from "react-dnd";
import "../Ticket.css";

export default function Ticket({ text }) {
  const [, drag] = useDrag({
    item: { type: "TICKET" },
  });

  return (
    <div ref={drag} className="ticket">
      <p>{text}</p>
    </div>
  );
}
